import React, { useEffect, useState } from 'react';
import axios from 'axios';
const PromoTable = () => {

    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:5033/api/PromocodeApi/GetAll')
            .then(response => {
                setData(response.data.result);
            });
    }, []);


    return (
        <table>
            <thead>
            <tr>
                <th>ID</th>
                <th>Name</th>
                <th>SumDiscount</th>
                <th>Remainder</th>
                <th>MinAmount</th>
            </tr>
            </thead>
            <tbody>
            {data.map(item => (
                <tr key={item.id}>
                    <td>{item.id}</td>
                    <td>{item.name}</td>
                    <td>{item.sumDiscount}</td>
                    <td>{item.remainder}</td>
                    <td>{item.minAmount}</td>
                </tr>
            ))}
            </tbody>
        </table>
    );
};

export default PromoTable;
